import React from 'react';

function InfoSection({ title, content, image }) {
  return (
    <section className="info-section">
      <img src={image} alt={title} />
      <div className="text">
        <h3>{title}</h3>
        <p>{content}</p>
      </div>
    </section>
  );
}

export default InfoSection;
